import React from 'react'

export const GetTicketDetail = (props) => {
    let style = {
        marginLeft: "auto",
        marginRight: "auto",
        marginBottom: "20px",
        width: "70%"
    }
    let creation_date =props.TicketDetail.creation_date.toISOString().replace(/T/, ' ').replace(/\..+/, '')
    return (
        <>
            <div style={style} className="card text-center">
                <div className="card-header">{props.TicketDetail.title}</div>
                <div className="card-body">
                    <h5 className="card-title">{props.TicketDetail.bucket_name}</h5>
                    <p className="card-text">
                        Desctiption: {props.TicketDetail.description}
                    </p>
                    <p className="card-text">
                        Acceptance Criteria: {props.TicketDetail.acpt_criteria}
                    </p>
                </div>
                <div className="card-footer text-muted">{props.TicketDetail.creation_date}</div>
            </div>
        </>
    )
}
